#include <iostream>
#include <unordered_set>

	using namespace std;
    int lengthOfLongestSubstring(string s) {
    	// if(!s.length()) return 0;
        unordered_set<char> set;
        int res = 0;
 		int lo = 0, hi;
 		while(lo < s.length() - res) {
 			if(lo < s.length()-1 && s.at(lo) == s.at(lo+1)) {
 				lo++;
 				continue;
 			}
 			hi = lo;
 			while(hi < s.length()) {
 				char c = s.at(hi);
 				if(set.find(c) != set.end()) {
	            	//got end
	            	if(set.size() > res) {
	            		res = set.size();
	            	}
	            	set.clear();
	            	break;
	            } else {
	            	set.insert(c);
	            	hi++;
	            }   
 			}
 			if(set.empty() == false) {
 				if(set.size() > res) {
	            		res = set.size();
	            	}
	            	set.clear();
 			}
 			lo++;
 		}

        return res;
    }
